import React, { useState } from 'react';
import CsvLoader from './components/CsvLoader';

function App() {
  const [crops, setCrops] = useState([]);  // Store all crops from CSV
  const [selectedCounty, setSelectedCounty] = useState('');  // Selected county
  const [selectedCropType, setSelectedCropType] = useState('');  // Selected crop type
  const [selectedPlantingSeason, setSelectedPlantingSeason] = useState('');  // Selected planting season
  const [availableCrops, setAvailableCrops] = useState([]);  // Filtered crops

  // This function will be called when CSV data is loaded
  const handleDataLoaded = (csvData) => {
    console.log('Parsed CSV Data:', csvData);  // Log the parsed CSV data for debugging
    setCrops(csvData);  // Store the parsed crop data into the crops state
  };

  const handleCountyChange = (e) => {
    setSelectedCounty(e.target.value);  // Update the selected county
  };

  const handleCropTypeChange = (e) => {
    setSelectedCropType(e.target.value);  // Update the selected crop type
  };

  const handlePlantingSeasonChange = (e) => {
    setSelectedPlantingSeason(e.target.value);  // Update the selected planting season
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Filter crops based on selected county, crop type, and planting season
    const filteredCrops = crops.filter(crop =>
      crop.County === selectedCounty &&  // Make sure this matches the CSV field name for counties
      crop.Type === selectedCropType &&
      crop['Planting Season'] === selectedPlantingSeason  // Match planting season
    );
    setAvailableCrops(filteredCrops);  // Set the filtered crops to display
  };

  return (
    <div className="App">
      <h1>Texas Crop Rotation Planner</h1>

      {/* Load and parse the CSV data */}
      <CsvLoader onDataLoaded={handleDataLoaded} />

      {/* Form for filtering crops */}
      <form onSubmit={handleSubmit} className="form-group">
        {/* Dropdown for county selection */}
        <label htmlFor="county-select" className="form-label">Select County:</label>
        <select id="county-select" value={selectedCounty} onChange={handleCountyChange} className="form-select">
          <option value="">--Choose a county--</option>
          {Array.from(new Set(crops.map(crop => crop.County))).map((county, index) => (
            <option key={index} value={county}>
              {county}
            </option>
          ))}
        </select>

        {/* Dropdown for crop type selection */}
        <label htmlFor="crop-type-select" className="form-label">Select Crop Type:</label>
        <select id="crop-type-select" value={selectedCropType} onChange={handleCropTypeChange} className="form-select">
          <option value="">--Choose a crop type--</option>
          <option value="Legume">Legume</option>
          <option value="Root">Root</option>
          <option value="Fruit">Fruit</option>
          <option value="Leaf">Leaf</option>
        </select>

        {/* Dropdown for planting season selection */}
        <label htmlFor="planting-season-select" className="form-label">Select Planting Season:</label>
        <select id="planting-season-select" value={selectedPlantingSeason} onChange={handlePlantingSeasonChange} className="form-select">
          <option value="">--Choose a planting season--</option>
          {Array.from(new Set(crops.map(crop => crop['Planting Season']))).map((season, index) => (
            <option key={index} value={season}>
              {season}
            </option>
          ))}
        </select>

        <button type="submit" className="btn btn-primary">Get Crop Recommendations</button>
      </form>

      {/* Display filtered crops */}
      {availableCrops.length > 0 && (
        <div>
          <h2>Available Crops</h2>
          <ul>
            {availableCrops.map((crop, index) => (
              <li key={index}>
                {crop.Crop} - Plant: {crop['Planting Season']}, Harvest: {crop['Harvest Season']}
              </li>
            ))}
          </ul>
        </div>
      )}
    </div>
  );
}

export default App;
